import React from 'react';

const PortfolioSection = () => {
  const works = [
    { title: 'Project 1', description: 'Interactive Quiz Application', img1: '/src/asstes/image-1.png' },
    { title: 'Project 2', description: 'Portfolio Website', img2: '/src/asstes/image-2.png' },
    { title: 'Project 3', description: 'Weather Application on React', img3: '/src/asstes/image-3.png' },
  ];

  return (
    <section className="py-10">
      <h2 className="text-3xl font-bold text-center mb-6">Portfolio</h2>
      <div className="flex justify-center flex-wrap gap-10">
        {works.map((work, index) => (
          <div key={index} className="bg-gray-800 p-6 rounded-lg shadow-lg">
            <img src={work.img1} alt={work.title} className="rounded-lg mb-4" />
            <img src={work.img2} alt={work.title} className='rounded-lg mb-4'/>
            <img src={work.img3} alt={work.title} className='rounded-lg mb-4'/>
            <h3 className="text-xl font-bold">{work.title}</h3>
            <p className="mt-2 text-gray-400">{work.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default PortfolioSection;
